import React from "react";
import Card from "react-bootstrap/Card";

const BoneyMEvent = () => {
  return (
    <div>
      <Card
        className="row d-flex justify-content-center mx-auto mb-5 mt-5"
        style={{ width: "50rem", border: "0" }}
      >
        <Card.Img
          variant="top"
          src={boneym}
          style={{ height: "200px" }}
          className="mb-3 mt-2"
        />
        <Card.Body>
          <Card.Title>Boney M</Card.Title>
          <ListGroup className="list-group-flush">
            <ListGroup.Item>
              <Card.Text>
                <BsCalendarCheck class="me-2" />
                24 Februarie 2024{" "}
              </Card.Text>
              <Card.Text>
                <AiOutlineClockCircle class="me-2" />
                20:00
              </Card.Text>
              <Card.Text>
                <ImLocation /> Sala Palatului, Bucuresti{" "}
              </Card.Text>
            </ListGroup.Item>
          </ListGroup>
          <Button variant="outline-warning" className="ms-2 mt-2">
            <Link to="/boneyM">Cumpara Bilete </Link>
          </Button>{" "}
        </Card.Body>
      </Card>
    </div>
  );
};

export default BoneyMEvent;
